import React from 'react'
import styled from "styled-components";

export default function Home() {
  return (
    <Wrapper className='test'>Home</Wrapper>
  )
}

const Wrapper = styled.section`
background-color: ${({theme})=> theme.colors.bg};
width: 20rem;
height: 20rem;
`;
